import React from "react";
import MultiplePizzas from "../assets/f.jpg";
import "../styles/About.css";
function About() {
  return (
    <div className="about">
      <div
        className="aboutTop"
        style={{ backgroundImage: `url(${MultiplePizzas})` }}
      ></div>
      <div className="aboutBottom">
        <h1> ABOUT US</h1>
        <p>
        HomeMade is here to help you cook delicious meals with less stress and more joy.
        We offer recipes and cooking advice for home cooks, by home cooks.
        Helping create “kitchen wins” is what we’re all about.
        </p>
        <p>
        Our recipes primarily use fresh, unprocessed ingredients but we also believe there is a time and a place for canned,
         frozen, and other prepared ingredients. We believe in a diet that includes a wide variety of foods: real butter and cream,
         extra virgin olive oil, eggs, lots of fruits and vegetables, and protein from meat, fish, beans, and cheese. Plus cake for dessert.
      
        </p>
        <p>
       at Simply Recipes, we aspire to provide the highest quality content produced by humans, for humans.
       
        </p>
      </div>
    </div>
  );
}

export default About;
